(109, '19888f7d638fc270c7dac0fb8036ccc5aa3cc7a5e4c8660072e43168d6597e5c', 'I called MD\'s OT and Emma confirmed that MD can now be supported with single carer after discussing with son. I called MD\'s social worker Violet after speaking with carers. This morning carer informed that MD is still very not able to support herself to remain standing for pad change as she is still at risk of fall. Social worker to revert to OT to establish concern.', '2024-08-21', '10:55am', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(110, '04732085100406424df31c8b86866269b05dc7f1b5a2bee798b564b68ecae4b4', 'I also spoke with son about mum\'s missed call last week which Mum called to inform that the scheduled carer did not come for her lunch call. at time of call was about her tea call and the tea call carer was already on the way to her, I apologised to son that this has happened. son accepted apology and said that I should not worry about it as Mum was fine after the tea call carer came to her. Carer was spoken to on the phone, Marion explained that she was not informed that she had been scheduled to attend the call as it was not her regular call.\r\n\r\nDavid confirmed that JW\'s morning and lunch calls for sunday should be cancelled as Mum will be going out for lunch with Him. He also informed about JW who will be going for respite in a care home on Monday August 26th as there will be some work in her house to fix a damp wall. Son informed that he will re comfirm this with us after the weekend', '2024-08-21', '11:01am', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(111, '33248d04d2cc7c8af731e1101657c3cc06d58b8f4ac2f74f5fd8403f5eb742ce', 'I called social service and spoke with Jane, to establish a concern of MS requesting to sit on her chair in bedroom but the space in her bedroom would not permit the bedroom chair and molift as she is not able to weight bare. I also mentioned that MS requested to be supported with a bathe sometimes but the space in bathroom will not permit such maneuver. Jane informed that she would pass this on to social worker Daren who will contact.', '2024-08-21', '11:57am', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(112, '6dc73792ce36cc9b7f7a3caad05c9b1150e7220c3ef1d7867079b0a819d64a57', 'from 23rd August WS will be moving to new address\r\n\r\n8 Sheraton Close, Hednesford, WS12 4SH\r\n\r\n', '2024-08-21', '01:04pm', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(113, '6dc73792ce36cc9b7f7a3caad05c9b1150e7220c3ef1d7867079b0a819d64a57', 'Daughter informed that she would be setting up his medication safe by tomorrow.', '2024-08-21', '01:05pm', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(114, '33248d04d2cc7c8af731e1101657c3cc06d58b8f4ac2f74f5fd8403f5eb742ce', 'Daren called back and I explained the situation. Daren said that he would be speaking with her. and ask the OT to see her as well.', '2024-08-21', '02:51pm', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(115, '33248d04d2cc7c8af731e1101657c3cc06d58b8f4ac2f74f5fd8403f5eb742ce', 'Daren informed after speaking with MS that it is not possible for MS to use the bathe due to the space. also stated that MS should be given the choice of sitting out on chair in the lounge as there is not enough space in bedroom and if declined she would only be supported to the commode as there is not enough space in bedroom for the chair. carer to continue to explain this situation to MS.', '2024-08-21', '03:28pm', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(116, 'cda4faef51ffd5c5254ff8dec176aa38227cd3786535d4623490eefe7d1d4753', 'Carol called to request cancellation of SC and CC\'s lunch call on 28/09/4 as family will be out to celebrate SC\'s birthday.', '2024-08-21', '04:50pm', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
(117, '8fed11e0091e75c45d4574434716eaf3148a622c037002c42d88ea11e950e8da', 'Daughter called Sophia to request cancellation of Tea call due to hospital appointment.', '2024-08-21', '10:02am', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-08-21 14:27:46'),
