(1, 'Mrs.', 'Ann', 'Allan', 'Ann', 'Ann', 'ann4allan@yahoo.com', 'She/Her', '1942-09-19', 'Asthma, Knee Osteoarthritis, Hypertension (High Blood Pressure), Falls, Increased Cholesterol, Myxoedema, Hypothyroidism, Obesity, Atrial Fibrillation, COPD. ', '1902844660', '07732283944', 'Christianity', 'Female', 'Codsall', '25', 'Ravenhill Dr, Codsall', 'Wolverhampton', 'Staffordshire', 'WV8 1BL', 'United Kingdom', 'Key-safe 1942', 'I live alone at my home for 40 years and I am a widow. I wish to remain living in my home for as long as possible.  I was employed as a district nurse for 40 years. Ann has full mental capacity to make decisions and able to say what she would like. Kindly prepare lunch of choice on morning call and leave near Ann to access. ', 'Wolverhampton', '2023-10-24', '', '8c6eab6d483f5afb47386b79f16ea75e9364d63431426a8114d5e61cac968da4', 'Domiciliary care', 'I have two sons and they are very important to me.  My home is important to me and Loughree, Ireland where i was born. ', 'I dislike prejudice people.  I enjoy reading, crosswords, puzzles, listening to classical music and watch television. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '34.03666', '-118.44346', '', '100498225', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-12-04 09:25:12'),
(2, 'Mr.', 'Phillip', 'Flavell', 'Flavell', 'Phil', 'philflavel@gmail.com', 'He/Him', '1955-08-09', 'Bed bound', '7432784981', '07399421146', 'Christianity', 'Male', 'Codsall', '68', 'Orchard Lane, Billbrook', 'Wolverhampton', 'Staffordshire', 'WV8 1NH', 'United Kingdom', '1300', 'Please contact partner before attending to PF care calls.\r\nlunch- call around 12:30 | Tea time- call around 14:15 | Bed Time- call around 17:00', 'Wolverhampton', '29/09/2021 ', '', '7fdd0c7ce449d6a8b38e9b68b7dfefa490bc636cf773c324015207c1e2ca5f65', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0033369', '-2.1827408', '', '6001731', '6799006d69c83.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:06:05'),
(3, 'Mr.', 'Steven', 'Clifford', 'Clifford', 'Steven', 'stevenclifford@gmail.com', 'He/Him', '1964-12-10', 'Heart failure, Diabetes type 2 (DOES NOT HAVE SUGAR), anxiety and depression, Hypertension, Osteoarthritis, Left Ventricular Systolic Disfunction, Cellulitis. SC is double continent and mobilises independently. Easily gets breathless after walking short distances.', '7438590832', '07399421146', 'Christianity', 'Male', 'Codsall', '40', 'Bakers Gardens', 'Wolverhampton', 'Staffordshire', 'WV8 1HA', 'United Kingdom', 'Key-safe 8642', 'Steven is a happy independent and chatty man who likes to continue to maintain his independence.  DNAR: NO. SC lives alone in bungalow, family and friends come to visit sometimes.  SC is double continent and mobilises independently. easily gets breathless after working short distances.\r\nSC administers medications independently by self.\r\nSC explained that he sometimes tumbles over due to his arthritis.\r\nSC has bandaged dressing on his left foot due to an injury from a fall six weeks ago, district nurse visits to dress two times weekly.\r\nsupport with:\r\nPersonal care: SC Washes or showers himself independently in the bathroom, carer to support with puting on the limbo cover on the bandaged left foot before shower.\r\nSC likes showering self alone in bathroom, after shower and drying self, carer to support with washing feet, taking off the limbo bag and putting on clothes.\r\nMeal preparation: Carer to support with preparing breakfast (likes a piece of toast with a cup of coffee with 3 sweeteners).\r\nCares to support with changing beddings when required.', 'Wolverhampton', '2024-04-06 ', '', '051bab0c7a18f3b4bccb1bbe3a6b62e2dd8f06be2364754e4e0fab14cf724c9d', 'Domiciliary care', 'My friends and family are very important to me.', 'Likes to spend time on his computer.', 'Null', 'Diagnosis: heart failure, Diabetes type 2 (DOES NOT HAVE SUGAR),  anxiety and depression, Hypertension, Osteoarthritis, Left Ventricular Systolic Disfunction, Cellulitis.  SC is double continent and mobilises independently.  Easily gets breathless after working short distances.\r\nSC administers medications independently by self.  SC explained that he sometimes tumbles over due to his arthritis.  SC has bandaged dressing on his left foot due to an injury from a fall six weeks ago, district nurse visits to dress two times weekly.', 'Null', 'Null', 'Null', 'Null', '34.03666', '-118.44346', '', ' 9826799', '67990123993f7.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:09:07'),
(4, 'Mrs.', 'Valerie', 'Allcock', '', 'Val', 'valerieallcock@gmail.com', 'She/Her', '1942-01-06', 'Poor mobility', '01902842400', '', 'Christianity', 'Female', 'Codsall', '11', 'Chadwell gardens', 'Wolverhampton', 'Staffordshire', 'WV8 1AF', 'United Kingdom', '1942', '', 'Wolverhampton', '25/09/2024', '', '696d9863e1aceb539878d00e2a346be4e3bdbfdf649c7ec8f919ffafd15052c6', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '34.03666', '-118.44346', '', '7147054', '679901825974d.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-03-04 12:28:19'),
(5, 'Mr.', 'Christopher', 'Haynes', 'Haynes', 'Chris', 'christopherhaynes@gmail.com', 'He/Him', '1952-07-31', 'Bed bound', '1902842252', '7920446791', 'Christianity', 'Male', 'Codsall', '19', 'Chadwell Gardens', 'Wolverhampton', 'Staffordshire', 'WV8 1AF', 'United Kingdom', 'Key Safe: A31B25', 'Christopher likes to be called Chris, He is a family man, he lives with his wife Joe, daughter and grand children. Chris was a banker and he loved the job while he was still active, because he had the opportunity to travel places.  Currently he stays on the bed in the room always, but goes out on his electric wheel at every lunch calls and tea calls if the weather is friendly. Chris experiences spasm when repositioning. His wife handles his medication and nutrition. All care materials are usually placed on the bedside table by his wife for care staff. However, extra supplies are in the room cupboard. He wares pressure socks in the morning and replaces them with air heel splints at bed calls. He alternate his catheter straps on both legs every morning. ', 'Wolverhampton', '15/03/2023', '', '137820e5e30ef52aac3976f7df4634ab898b3d8cd7927f1faa9779c72498894e', 'Domiciliary care', 'His wife is very important to him because she is responsible for his medication, nutrition and general well being. They spend most of their time together. ', 'After personal care, Chris likes being completely dressed up in the morning on the day the district nurse is visiting. He goes on the electric wheel after lunch call, returns to his room at 4pm and back to his wheel at 5:30pm.  Chris used to travel places, but due to health challenges now enjoys watching movies in his room', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '34.03666', '-118.44346', '', '6061482', '6798f62ddc93b.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:22:21'),
(7, 'Mrs.', 'Eileen', 'Edbury', '', 'Eileen', 'don-eileen@talktalk.net', 'She/Her', '1941-10-14', 'Blood cancer of the spine.', '7521495007', '01902842563', 'None', 'Female', 'Codsall', '2', 'Glen Ct, Codsall ', 'Wolverhampton', 'Staffordshire', 'WV8 1PZ', 'United Kingdom', 'Key safe: 2563\r\nKeysafe is by the front door.', 'Highlights\r\n\r\nEileen is an elderly lady who lives alone in her house. has 3 daughters, one of them lives local who supports her with household chores and shopping.\r\nDiagnosis: Blood cancer of the spine.\r\nEE had a fall sometime ago which had led to her present condition of her spine. \r\nEE communicates verbally, independently mobile with a frame, full mental capacity, double continent and supports herself with her medication.\r\nsupport of one carer is required with personal care dresssing, creams, putting on leg boots and brace to support her spine when walking, meal preparation may be requested if EE is not able to.', 'Wolverhampton', '2024-05-29T00:00', '', '940247676fd00dec24bf4a6f2bb05219d8e6a7564253285c4533fbe64d6b8a73', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6293671', '-2.1912795', '', 'CHC', '6798f94fb9ef9.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:35:43'),
(8, 'Ms.', 'Marcelle', 'Dovey', '', 'Marcelle', '', 'She/Her', '1929-07-23', 'Diagnosed with Dementia, arthritis.  Marcelle used to be very active and independent until a fall in the landing about 9 days ago. expecting visit by OT on Monday to assess needs with moving and handling, currently struggles to stand and transfer due to pains and legs been weak. support with transfer to commode and resting chair when able. ', '1902842685', '', 'None', 'Female', 'Codsall', '3', 'Madeira Ave', 'Wolverhampton', 'Staffordshire', 'WV8 2DS', 'United Kingdom', 'Key safe: not yet installed.\r\nFamily will be in to grant carer access until key safe is installed. porch door is not always locked, open and knock on inner door.', 'Marcelle is a nice independent elderly lady who likes to be independent in her home, has a son and a daughter, son visits daily to sleep over most of the time. very chatty, hard of hearing, carer need to come close and speak loundly and slowly to hear. Diagnosed of Dementia, arthritis.\r\nMarcelle used to be very active and independent until a fall in the landing about 9 days ago. expecting visit by OT on monday to assess needs with moving and handling, currently struggles to stand and transfer due to pains and legs been weak. support with transfer to commode and resting chair when able.\r\nMarcelle complains of pains most of the time, tends to be sick often, anti sickness tablet to be administered when required morning, lunch and tea time when required.\r\nshe is been visited by the district nurse due to an infected wound on left arm. monitor wound and report any concern to office if seen weeping. document and report any concern. \r\ncomplete all tasks as scheduled.\r\ndoccument and report any concern.', 'Wolverhampton', '2024-06-14T16:03', '', '19888f7d638fc270c7dac0fb8036ccc5aa3cc7a5e4c8660072e43168d6597e5c', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6209638', '-2.186835', '', '9698829', '6798ff22a7ac2.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:00:34'),
(9, 'Mrs.', 'Cynthia', 'Atkins', '', 'Cynthia', 'sallywatkins37@yahoo.co.uk', 'She/Her', '1945-11-25', 'Medical History- Heart failure, Hypertension, Hypothyroidism, Bilateral leg ulcers, and Aortic Aneurysm. ', '1543279605', '', 'None', 'Female', 'Norton canes', '145', 'Brownhills Rd, Norton Canes, Cannock', 'Wolverhampton', 'Staffordshire', 'WS11 9SN', 'United Kingdom', 'key safe: 2203.Walk straight down the drive at the right side of the house, key safe is far end close to the back fence gate.', 'CA lives alone in her house, likes carers with a great sense of humor, communicates verbally with full mental capacity, is slowly mobile with frame,\r\nHas key safe in property, located at the right side of property close to the back gate. Support with personal care, and creams as scheduled. CA prefers a wash in bed, and a change of clothes, her dresses are hung at the back of the bedroom door and trousers are folded in the bedroom, socks are folded on the bedroom table. Encourage her to sit in the lounge on a recliner chair with a pressure cushion in place at morning call because CA may not be able to get off her bed alone without the carer\'s support. Assist in preparing a meal of choice. CA has fluid restriction of not more than 1200mls daily provide only one 300ml cup of tea at every call. Prompt to have medication, daughter already sorts out medication in a dose box by her side. Apply cream for pressure sore at the bottom as scheduled, ensure under the breast and belly fold is washed and dry, then apply creams as scheduled, apply cream on lower feet at all call times as scheduled. See creams in Birdie. the right leg is been dressed by the district nurse. The catheter was recently taken off her, double continent but Wears a pull-up pad for precautionary purposes. Monitor pressure sores at the bottom, under the breast area, and belly fold. CA often prefers to remain in a recliner chair after bed call. ensure to return the key to the key safe before leaving.', 'Wolverhampton', '2024-03-08T11:33', '', 'e566d3adb045a2a0c5438283d863bcb786ab0de853bbe49d2883b5f22e011add', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.670329', '-1.9641901', '', '100474334', '6798f86678c90.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:31:50'),
(10, 'Mrs.', 'Colleen', 'Rowley', '', 'Colleen', '', 'She/Her', '1942-09-04', 'Medical diagnosis- Arthritis in the knees and hands, Lymphedema, water retention, enlarge heart, vertigo, tinnitus, right hip replacement, anxiety and stress, currently has a Hernia in the stomach. Collen has full capacity to make decisions. ', '1543271667', '', 'Christianity', 'Female', 'Norton canes', '21', 'St James Road,, Norton Canes,, ', 'Wolverhampton', 'West Midlands', 'WS11 9QE', 'United Kingdom', 'Grandson will unlock door before carers arrive. If door is still locked on arrival, please knock on the door. ', 'I was born in 1942 and got married in 1963. I have 1 brother and 3 sisters. I have 1 child and 4 grandchildren. ', 'Wolverhampton', '2021-05-27T16:04', '', 'c3fde8257d2d464997efd2490bb7c3a2d95d1d8b3b895d2d107f5f217903a44e', 'Domiciliary care', 'My family is important to me. I live with my grandson who supports with some of my day to day living tasks. ', '\r\nI am a very easy going person so therefore there is not much I dislike. I really enjoy watching tv programmes like quiz shows, antiques programmes and old comedy. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6728807', '-1.9611334', '', '7148850', '6798f67f663af.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:23:43'),
(11, 'Mr.', 'Cebert', 'Watson', '', 'Bert', '', 'He/Him', '1931-05-10', 'Medical Condition- Type 2 Diabetes, Cancer, Hypertension (High Blood Pressure), Glaucoma, Heart issues, water retention in legs, Torn muscles in Both shoulders- unable to lift both arms up. ', '1902701584', '', 'Christianity', 'Male', 'Pattingham', '3', ' Letchmere Cl, Pattingham, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV6 7AJ', 'United Kingdom', '1426- use key safe inside the porch to access the property not the key safe outside on the wall. ', 'I live alone but my son stays with me occasionally to provide care support. I was born in Hanover, Jamaican. Please walk with Bert when mobilising and monitor he is seated safely. Ensure Zimmer frame is left near Bert. Avoid talking about his late wife, Bert will become emotional and upset. \r\nBert likes Jamaican food which daughter prepares and store in the freezer. Ask Bert what he would like to eat, prepare and serve in the living room on a tray. \r\nBert attends day centre every Tuesday and require to be ready to arrive at day centre at 9:30 in the morning. Personal Care items in the bathroom, clothes and pads are in the bedroom. Bert is prone to falls due to having dizziness.\r\nCheck PRN on app for medication and asked Bert if he would like to take medication and administer. Blister pack and eye drops is kept on dressing table with mirror in a white storage box. ', 'Wolverhampton', '2024-03-11T09:24', '', '1f2c8c852fe03636749e40bb91aae71b3c80381cb7c432b9d82f9651833b0ddc', 'Domiciliary care', '\r\nMy family is very important to me. ', '\r\nI dislike profanity, garlic, Indian curry and pork. \r\nI use to enjoy playing cricket, draft, gardening and listening to music. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5878135', '-2.2603399', '', '6069509', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(12, 'Mr.', 'Dennis', 'Pratt', '', 'Dennis', 'debbie.taylor01@hotmail.com', 'He/Him', '1946-08-16', 'Medical Diagnosis- Parkinson\'s disease, Demetia, Diabetes (Type 2), Arthrittis, Asma, Hypertension. ', '1543877270', '', 'Christianity', 'Male', 'Cannock', '19', 'Sussex Drive, Cannock', 'Wolverhampton', 'West Midlands', 'WS12 1AT', 'United Kingdom', 'key safe- 8723\r\n000- code for medication bag. ', 'I live alone in my flat for about 14 years. My daughter visits  me regularly and takes me out sometimes during the day. \r\nI would like carers to attend to my care calls on time to support me with my medication, personal care and food preparation. I tend to become anxious when carers are running late and might call for daughter for reassurance. ', 'Wolverhampton', '2023-02-28T09:21', '', '8fed11e0091e75c45d4574434716eaf3148a622c037002c42d88ea11e950e8da', 'Domiciliary care', 'My family is important to me. I have a close relationship with my daughter Debbie, she takes me out sometimes for lunch. ', '\r\nI am quite laidback and easy going< i do not have much dislikes. \r\nI Like to watch sports on TV and read my news papers in my lounge where I sit most of the day. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.7067745', '-2.0028138', '', '7173009', '6798f8c33001b.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:33:23'),
(13, 'Mr.', 'Alan', 'Jones', '', 'Alan', 'mrsmiller1711@yahoo.com', 'He/Him', '1942-09-25', 'Diabetes, Stroke, Atrial Fibrillation, Hypertension, High Cholesterol, Right sided knee replacement, Cataract removed in both eyes and registered blind. ', '7815535020', '1543317545', 'Christianity', 'Male', 'Burntwood', '57', 'School Lane, Burntwood, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS7 1LB', 'United Kingdom', '6666- Key safe by side door where to enter. ', 'I live with my daughter, son in law and grandchildren. I am a widower, my wife passed away in 2011.   I was employed in the RAF and as service engineer at Birmingham airport.', 'Wolverhampton', '2024-02-09T11:40', '', '27c614a46d54234eb402b6d53e84999b7b678fa31daa24ef299208bf161b1dce', 'Domiciliary care', 'My family and my sister in law is important is me. My ultimate goal is to be able to go out on my mobility scooter. ', '\r\nI am quite easy going or have much dislikes. \r\nI enjoy watching snooker and darts on tv. I enjoy sitting out in the garden. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6856848', '-1.9459565', '', ' 8607314', '6798ee4c443aa.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-03-10 13:39:16'),
(14, 'Mr.', 'Carl', 'Cross', '', 'Carl', 'auntsal@hotmail.com', 'He/Him', '1936-06-15', 'Hernia, Diabetes. DOES NOT HAVE SUGAR', '1543371191', '07955838107', 'Christianity', 'Male', 'Walsall', '23', 'Westwick Cl, Walsall, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS9 9EA', 'United Kingdom', 'Key safe: 1963\r\nLocation: Inside the front porch.', 'Carl lives with wife in their home. has full mental capacity. Likes to be listened to when supported with his care needs.\r\nCarl is hard of hearing: you need to speak loud and as clearly as possible.\r\nCarl would get upset and frustrated when not been listened to.\r\nDNAR: NO\r\nSupport self with medications, carer to support with creams.\r\nRelies on Zimmer frame to mibilize.\r\nCatherterised and Colostomy in place.\r\nHas normal diet, likes coffee, tea, likes to have cranberry juice in the morning.\r\nPersonal care: Likes to have his wash in bed. Carl would have detached night bag by himself before carers arrive. \r\nsupport out of bed to swing leg out of bed.\r\nEmpty catheter, support with catheter care and report quantity and nature of urine.\r\nUse 2 bowl and 2 flanels for personal care: light coloured bowl and bright coloured flannel are for the face and upper body.\r\nDark coloured flannel and dark coloured bowl are for private areas and lower body parts.\r\nMaintain dignity by covering up with towel during personal care and when changing pouch.\r\nApply Talcum powder to back after body wash and dry.\r\nWash Hernia properly and dry, apply medi horney to dry hernia area.\r\nClean catheter area properly with the right flannel and dry, apply Clotrimazole cream to arround the tip of penis as scheduled \r\nCheck skin integrity.\r\nsupport with stoma care and pouch change before dressing up, change pre cut single use stoma pouch every morning and dispose bag (have new pouch ready, bag to dispose old pouch, scissors to cut, warm water in a clean bowl and wipe to clean with. \r\nReplace colostomy by changing seal every 7 days; gently peal off the seal by spraying around with adhessive removal provided by Carl to allow safe removal of the seal.\r\nTIPS:\r\nWash your hands and collect your supplies, such as a new bag, adhesive remover, and a disposal bag.\r\nChoose a time when your stoma is not active, such as first thing in the morning.\r\nEmpty your bag or remove single use bag as usual and remove the pouch seal carefully by first spraying adhessive removal, peeling away any adhesive products from the skin.\r\nclean your stoma gently with water and a soft wipes provided and dab gently to dry.\r\nreplace with a new bag and any accessories you use.\r\nSupport with putting on clean clothes and ensure safety when mobilized to lounge.\r\n support with drinks of choice and meal preparation.\r\nCarl will always have coffee or tea (No sugar).\r\nwash and refill water bottle with fresh water, offer a glass of cranberry juice every morning.\r\nmake breakfast following notes posted on door of kitchen cupboard. Note that Carls food items are well labelled in the fridge, do not offer Carls food items to the wife as she is Vegetarian. \r\nalways prepare sandwich as directed for tea time and leave in fridge every lunch call (ensure the sandwich is well wraped with film in the pantry in kitchen and attached a label on it with Carl\'s name stating for tea) the pantry a door to your right when you enter the kitchen, \r\nDaughter sometimes prepare meal and label in fridge for carers to warm up.\r\nPrompt Carl to take his Atorvastatin tablet at every bed call.\r\nPrompt to take Atorvastatin at bed call.\r\nconnect night bag at bed call and ensure it is draining.\r\nCheck stoma at bed call to ensure it is well secured.\r\nEnsure heater in the lounge is facing bedroom at bed call.\r\nCarl will inform how he wants his bed pillows positioned.', 'Wolverhampton', '2024-04-16T12:25', '', 'a38e5f1b1b9ec5c9303d7ab486a396cd9b12484fd3cef800659392fab09853c9', 'Domiciliary care', 'My wife, family and my general wellbeing are very important to me.', 'I like to be listened to at all stages of my care and for my choices to be respected.', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6327396', '-1.8946655', '', 'Private', '6798f57e00e11.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:19:26'),
(15, 'Mrs.', 'Eileen', 'Orgill', '', 'Eileen', '', 'She/Her', '1934-01-18', 'Bed Bound', '1543378385', '', 'None', 'Female', 'Burntwood', '210', 'Main St, Walsall, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS9 9EB', 'United Kingdom', 'Key safe: 8385.\r\nLocation: the key safe is at the right side of the building (side of garage). Attached to the short fence on the right by the bins.', 'Eileen is an elderly lady who live with husband and son in their house. EO has full mental capacity and able to communicate verbally. Double continent but wears pad for precautionary purposes (Large slip pad for the night and smaller slip pad for day) support to change Morning and Bed call. EO is not able to weight bare currently, transfer is by hoist and toileting sling in the property. (slinge hooks are Purple at bottom and Red at the top)\r\nEO has daily wash while hoisted to sit on the commode every morning and to use the commode. wash with warm water and flannel on the commode and support with clothes change, apply barrier creams to bottom pressure sore then transfer with hoist to sit in resting day chair. Prompt and support with oral hygiene daily.\r\n EO likes to maintain her independence, like carers to kep to time, and she can wash some parts of her body when given the flannel.\r\nher Husband supports with other medications and meal preparation. carers to support with meal preparation when the husband is not available.\r\nEO likes to have her hair wash once in every 2 weeks, support with hair wash and dry as hair dresser will be coming to dress her hair.\r\n', 'Wolverhampton', '2024-05-21T12:16', '', '1c6d54f80772f28544e0790e362ccc93e23a5d65195dd10ab74172943ddb198f', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.586214', '-1.982919', '', '9656224', '6798f9351be20.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:35:17'),
(16, 'Mr.', 'Charles', 'Foye', '', 'Charles', '', 'He/Him', '1960-11-12', 'Norwegian scabies, Self-neglect', '7754061268', '01543570938', 'None', 'Male', 'Cannock', '4', 'Avalon House, Flat 4, Horton Cl, Cannock, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS11 5EY', 'United Kingdom', 'Key safe: Reception Entrance: 2022(Smaller safe).\r\nKey safe Flat 4: 1960.\r\nYou can call flat 4 on the call button at entrance and Charles will come to let you in or use the key safes. Ensure keys are returned to key safe immediately after used and secured.\r\nLocation: walk into reception, then walk straight down, flat 4 is just after flat 3.', 'Charles lives in a flat in a supported living home with staff\'s presence, The staff, Karen supports with collecting of cream from pharmacy. Charles has Scabis all over body (scabis is contagious, Use complete PPE and observe full infection control procedure. dispose PPEs when out of the flat in the green bin opposite flat 4). use hand sanitizer.\r\nCharles is able to answer the phone at all times.\r\nCharles is mobile, communicates verbally, has mental capacity. \r\nSupport Charles with Cream all over body ( between fingers, back, bottom, arround the penis, etc.\r\nAlso support with a shower in the morning; Charles has history of self neglect and encouragement is required with having a shower daily. document every tasks done. Charles is independent with his medication and meal preparation.\r\ncarer to support with application of cream as directed, document and report any concern to the office.\r\nCF was in hospital for some time and would not respond to his own personal care needs.\r\nGreen bins are positioned in the left corner in opposite CF\'s flat for PPEs to go into immediately.', 'Wolverhampton', '2024-05-13T14:10', '', 'a7eebd913601ec7591e8a4113d8b76a9cfa6ec53b5789855c1363ecb08a60494', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.7027622', '-2.0166153', '', '9623836', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 15:41:50'),
(17, 'Mrs.', 'Cheralyn', 'Sanders', '', 'Cheralyn', '', 'She/Her', '1954-10-13', 'Bed bound but have full mental capacity. Medical history: Diabetes type, Anxiety reaction, Lymphedema', '1543675246', '07518833578', 'None', 'Female', 'Burntwood', '13', 'Poplar Avenue, Chasetown', 'Wolverhampton', 'West Midlands', 'WS7 4RH', 'United Kingdom', 'Key safe -1357', 'Cheralyn is bed bound and rely on care worker and her husband to support with her care needs. Carers to support with personal care needs, strip wash, change pad, clothes and prepare cup of tea if requested. ', 'Wolverhampton', '2023-05-19T14:25', '', 'b47394ea1de92ad10be0fb4579a5c5844213c71c0009ebbc52ca5405b75ed242', 'Domiciliary care', 'Null', 'Null', 'Null', '\r\nDiabetes type, Anxiety reaction, Lymphedema', 'Null', 'Null', 'Null', 'Null', '52.6109317', '-2.093936', '', '8059527', '6798f5ff67c4e.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:21:35'),
(18, 'Mr.', 'Dennis', 'Brown', '', 'Dennis', '', 'He/Him', '1948-05-11', 'Dementia, Angina, Low blood pressure (Monitored).', '1543270633', '', 'Christianity', 'Male', 'Norton canes', '4', 'Norton Grange Crescent, Norton Canes', 'Wolverhampton', 'West Midlands', 'WS11 9RA', 'United Kingdom', 'Wife open door when carers arrive. ', 'I was born in Aston in Birmingham. I support Aston Villa football team. I am married to my wife joy for more than 50 years. I have 2 daughters and 3 grandchildren.  I have sit in service every Monday and Friday. Carers to change pad, reposition up the bed if required. Prepare cup of tea with milk no sugar and a sandwich. ', 'Wolverhampton', '2022-11-04T15:23', '', '35e0d9a9fd3aad45a0237d15edc9dc43d630d42fec338e74201382d0d21346d6', 'Sit-in Care', 'My family is important to me and I become excited whenever my grandchildren visits.', 'I do not like a lot of noise or liked being followed. \r\nI used to enjoy making things out of wood, playing football, cricket, swimming, squash and fishing. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6687818', '-1.975358', '', '9810541', '6798f89ac0ca5.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:32:42'),
(19, 'Mr.', 'Derek', 'Forrester', '', 'Derek', '', 'He/Him', '1936-10-03', 'Organic Dementia,  DM-Diabetes mellitus, Stroke, right eye vision loss', '1543871060', '', 'None', 'Male', 'Cannock', '30', 'Tower Rd, Hednesford, Cannock ', 'Wolverhampton', 'West Midlands', 'WS12 4LJ', 'United Kingdom', '1936- Key safe, to locate the key safe, go to the right side of the property, enter through the gate, turn to the left, key safe  is by the kitchen back door on the wall. keys is for the front door. ', 'This is a health package only to support with medication due to poor vision and forgetfulness. \r\nMedical condition- Type 2 Diabetes, Stroke 2 years ago, right eye vision loss, Dementia.\r\nDerek is a nice elderly man who communicates nicely, is hard in hearing and mobilizes independently with a walking stick.\r\nAccess property with key safe; key safe is located at back of the property (walk through the gate at right back side of the property to the back, key safe is by the back kitchen door, then enter through the front door)\r\nAdminister medication as scheduled in app. Medications are to be administered from client\'s blister pack, Paracetamol is in original packet as PRN, prompt to use inhaler and Nitrolingual spray as PRN. Ensure doors are secured and key returned to the key safe before leaving.\r\nFamily comes daily to support with other needs.', 'Wolverhampton', '2024-03-11T15:51', '', '84f6da1f7d93384aa5699eccd466e6ec9a99f856dca41162e8806c03ab303002', 'Domiciliary care', 'Family and life in general is important to Derek.', 'Null', 'Null', 'Organic dementia, \r\nDM - Diabetes mellitus, \r\nStroke', 'Null', 'Null', 'Null', 'Null', '52.7269153', '-2.0169336', '', '9858937', '6798f913dba40.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:34:43'),
(20, 'Ms.', 'Julie', 'Hall', '', 'Julie', '', 'She/Her', '1955-12-15', 'Julie suffers from Depression, COPD, and Parkinson\'s disease and has a Colostomy or Stoma bag fitted. ', '7910891821', '01543899405', 'None', 'Female', 'Burntwood', '20', 'Spinney lane, Burntwood', 'Wolverhampton', 'West Midlands', 'WS7 2HA', 'United Kingdom', '1528- use key safe on top to the right. ', 'Julie suffers from Depression, COPD, and Parkinson\'s disease and has a Colostomy or Stoma bag fitted. \r\nJulie has the capacity to make decisions regarding her care needs. In case of an emergency, she can call for help and also support herself with some of her care needs. She dislikes loud noises.\r\nPlease be mindful that Julie smokes inside the property. \r\nShe is mobile but mobilises with a walking stick when she goes outside or her electric scooter when accessing the community. \r\nHer call is 45 minutes on Tuesday, Friday, and Sunday to support her to have a shower. \r\n>MORNING- assist to give a wash and a shower on Tuesdays, Fridays and Sundays also wash her hair if requested. Change clothes and apply a barrier cream. Prepare breakfast and drink of choice. Julie might asked to prepare sandwich for her tea. Julie changed stoma bag herself and also self medicates. Julie requested to leave the door unlocked until the bedtime visit, \r\nBEDÃ¢â‚¬â€Help her change into nightwear and prepare a drink and snacks of choice. Apply barrier cream to her bottom and check if she has taken the medication. Lock the door with the key and return it to the safe. \r\n\r\n', 'Wolverhampton', '2023-06-26T15:56', '2025-06-26T15:56', '1dc80f5a08738cee1057021e13a18d8ed2e5cbaa1dae801fca8752992e622a52', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6880668', '-1.932269', '', '7174650 ', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 13:22:56'),
(21, 'Mr.', 'Douglas', 'Mercer', '', 'Doug', 'smercer56@hotmail.com', 'He/Him', '1933-06-05', '-', '7931420494', '01543423592', 'Christianity', 'Male', 'Cannock', '33', 'Copperkins Rd, Hednesford , Cannock, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS12 2NW', 'United Kingdom', '2310- Keysafe- by garage by right hand corner. ', 'I was employed  at Dunlop tyres as a rubber worker making tyre. I then moved on to joint the army for two years. After resigning from the army I went into the wood trade business. \r\n', 'Wolverhampton', '2024-11-25 ', '2024-12-14', 'b3b3a475469778075d63cad134c752f985d75e679ff02d78ab6c24062ec1efe5', 'Domiciliary care', 'My family and my home is important to me.', '\r\nI do not worry about anything. I get on with life. \r\nI love gardening and DIY. ', 'Null', 'Parkinson\'s disease, Liver, Bone, Prostrate, and Bowel Cancer.', 'Null', 'Null', 'Null', 'Null', '52.701977', '-1.9855136', '', '9656224', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-02 16:40:06'),
(22, 'Ms.', 'Linda', 'Hancox', '', 'Linda', 'helen091168@gmail.com', 'She/Her', '1942-05-19', 'Diagnosed with COPD (respiratioy condition), Alzheimer (Dementia), Anxiety or Depression.', '1543425712', '07746740596', 'None', 'Female', 'Cannock', '1', 'Abbots Field, Cannock, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS11 4NP', 'United Kingdom', 'Key safe: 1968', 'Lives alone in her home but often visited by her family. \r\nDiagnosed with COPD (respiratioy condition), Alzheimer (Dementia), Anxiety or Depression.\r\nLH may appear confused most of the time as may not remember why she needs to take her medication or have some food. Communicates verbally and independently mobile, sometimes with a stick. \r\nShe may sometimes refuse carers into property hence she has got a key safe in place, requires encouragement in completing all tasks.\r\nnice and lovely but may get upset when she insists over what she wants.\r\nMedications are in three different blister packs dated and specifying call time to be administered, each for breakfast, lunch and bed, ensure to observe blister pack carefully to check the right section to pop for any call time, keep medication out of her reach where family has kept it on top of kitchen cabinet.  Please remind family to re-order  1 week before medication finished. \r\nencourage LH to come to kitchen to make meal of her choice; porrrigde is in kitchen cabinet close to blister pack, fridge in kitchen and freezer containing other ready made meal is in kitchen store (door accessible from kitchen). LH likes salmon source kept inside kitchen cabinet by kitchen entrance, monitor and record dietary intake as LH is at risk of malnutrition due to self neglect.\r\nEncourage with wash, hair combing, oral care and change of clothes; LH is capable of washing self, carers to support with hard to reach areas and cream, bed room is upstairs, first door to the left.\r\nEnsure to lock door and return keys to key safe when leaving. carers should ensure to inform LH not to double lock the entrance door from the inside at all call.\r\nLH is supported by family members; Joyce and Helen with emotional supports, shopping.\r\nLinda\'s family will continue to provide support with the shopping and ensuring Linda has enough food. \r\nLinda will need support to ensure food dates are checked. \r\nCarers to record diet and fluid intake on diet charts. \r\nCarers to ensure snacks and drinks are left between calls. \r\nCarers to encourage adequate diet and fluid intake. \r\nCarers to encourage Linda to participate when preparing meals.\r\nCarers to encourage LH to always put on her lifeline pendant (Its been ordered)\r\n', 'Wolverhampton', '2023-11-20T09:47', '', '3fe8e43f35fe9637e8bdf71c7363a385a47bb23c0764527a79d5080ea1484f62', 'Domiciliary care', 'Sister: Joyce Stewart and Step Daughter: Helen are important family members who support LH with emotional support through visits and telephone calls, arranging transportation for appointments as well as shopping.', 'Null', 'LH has only 2 teeth and find it difficult to eat some kind of food, LH is to be supported with preparing soft diet, eats brown bread.\r\nLinda\'s family will continue to provide support with the shopping and ensuring Linda has enough food. \r\nLinda will need support to ensure food dates are checked. \r\nCarers to record diet and fluid intake on diet charts. \r\nCarers to ensure snacks and drinks are left between calls. \r\nCarers to encourage adequate diet and fluid intake. \r\nCarers to encourage Linda to participate when preparing meals.', 'COPD - Chronic obstructive pulmonary disease, Feeling anxious, Alzheimer dementia.  Past medical history taken from the transfer of care document and care logs 13/11/23 -  Vascular disease, Congestive cardiac failure (CCF) , Eczema and skin allergies - E45 cream and Dermal creams prescribed, Ovarian cysts 4cm - not for further investigations, Neck and back pain , Reduced mobility - using a stick , Reduced diet and fluid intake - softer diet required due only having several teeth. Allergic to Penicillin and Rubber - red, rash and dry skin,', 'Null', 'Null', 'Null', 'Null', '52.7095301', '-2.0294089', '', '100461175', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 13:24:20'),
(23, 'Ms.', 'Winifred', 'Pringle', '', 'Winifred', '', 'She/Her', '1937-02-16', 'Chest Infection, Phenomena, Memory issues(Not Diagnosed} ', '7759929139', '', 'None', 'Female', 'Great Wyrley', '76', 'Hall Lane, Great Wyrley, Walsall', 'Wolverhampton', 'Bedfordshire', 'WS6 6LY', 'United Kingdom', '1637- key safe ', 'Cameras in the property.\r\nMedical history: current chest infection (on antibiotics), Phenomena. Memory issues, but not diagnosed as yet; memory clinic referral in place; COPD. \r\nWini is bedbound and unable to stand or walk. she can sit up in bed for a short period when she has fully recovered from current chest infection. \r\n\r\nWini can be quite grumpy as she is getting used to the changes and idea of having care support. Please reassure Wini when rolling her from side to side when providing personal care that she is safe and will not fall off the bed. Wash bowl is on the floor in the kitchen, clothes and other personal care items are in the bedroom. Daughter supports with medication and food preparation mostly, ensure she has enough fluids throughout the day.', 'Wolverhampton', '2024-03-25T10:24', '2025-03-25T10:24', '76dd20c63bde01a4043ccb110cf6480d9e8f421b2c109fc570009e30db9228e6', 'Domiciliary care', 'My daughter is important to me and she is also my main carer. My home is important to me and I wish to remain living at home as long as possible. ', '\r\nI used to like knitting and jigsaw puzzles. I also like to watch the Natural Channel on TV, and my son put up a bird feeder in the garden, as I enjoy watching the birds. \r\n\r\nI do not have much dislikes. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6655999', '-2.0159044', '', '100506808', '679901f5c71d5.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:12:37'),
(24, 'Mrs.', 'Margaret', 'Edgington', '', 'Margaret', '', 'She/Her', '1946-12-10', 'Left breast Cancer, Right hip replacement (Twice) Left Hip replacement, dislocated shoulder. Margaret is immobile and bedbound, transfer out of bed with hoist, however she has full mental capacity to make decisions. ', '1902700472', '', 'Christianity', 'Female', 'Pattingham', '7', 'Yew Tree Road, Pattingham, Wolverhampton', 'Wolverhampton', 'West Midlands', 'WV6 7AP', 'United Kingdom', 'Go round the back and through the patio doors', 'I live with my husband Tom in a house in Pattingham. I have two sons who visits me regularly. tom is incredibly supportive and assists with everything I need, outside of what the carers assist me with. due to  my health issues, I am currently bedbound and using a hospital bed and required a hoist to support with transfers. ', 'Wolverhampton', '2023-07-19T11:06', '', '3bb71d69c49bd36e9e0fe8696aed272975c1720e4cd834f9ca02b34f4047f7c4', 'Domiciliary care', 'My family and my home is important to me. ', 'I dislike when carers are late. I become upset and a little anxious when carers are late.   I used to enjoy going out for meals, to the theatre, to garden centre and visiting family. Since my health has deteriorate and I become bedbound, I like to watch tv, quizzes and cookery shows.   I prefer my morning call between 9- 9:30 and I do not like when carers are late. I like my incontinence pad to be put on a certain, how I have shown carers. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5882188', '-2.25945', '', '6021500', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(25, 'Mr.', 'William', 'Somers', '', 'John', 'rachel.somers@live.com', 'He/Him', '1964-05-15', 'None', '7804919321', '01543271536', 'Christianity', 'Male', 'Hednesford', '85', 'Sweetbriar Way, Cannock, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS12 2UL', 'United Kingdom', 'None: John will let you in when knock at the door', 'Preferred to be called John. JWs new address from 23 august will be 8 Sheraton Close, Hednesford, WS12 4SH\r\nlives with daughter, Rachel who is the point of contact.\r\ncurrently has no medical diagnosis as assessment is on going.\r\nJohn explained that he could feel depressed sometimes and has anxiety\r\nsupport with medication, John is taking some medications for his depression.\r\nPLS USE FACE MASK WHEN ATTENDING TO WS DUE TO FAMILY REQUEST.\r\nmonitor medication to be taken and record.\r\nJohn\'s short-term memory is poor, may not remember earlier discussions.\r\nmedication in blister back, and inhalers.', 'Wolverhampton', '2024-04-23T11:16', '2025-05-23T11:16', '6dc73792ce36cc9b7f7a3caad05c9b1150e7220c3ef1d7867079b0a819d64a57', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6958412', '-1.9891651', '', '100464340', '679901db56b65.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:12:11'),
(26, 'Mrs.', 'Muriel', 'Wilkes ', '', ' Mo ', '', 'She/Her', '1931-09-16', 'CVA, CKD 3, Postural Hypertension, Angiodysplasia of the stomach, Left shoulder injury ( unable to lift left shoulder above head). ', '1543682236', '', 'Christianity', 'Female', 'Cannock', '11', 'Victory Ave, Burntwood ', 'Wolverhampton', 'West Midlands', 'WS7 2AL', 'United Kingdom', '1930- key safe', 'I live alone and I am a widow. My husband died March 2024. I have two children whom I have a close relationship with. I would like to remain living in my own home for as long as possible.   \r\nI worked as a barmaid, factory worker and customer service assistant. \r\nMo has full mental capacity and can communicate her needs. \r\nMedical history- CVA, CKD 3, Postural Hypertension, Angiodysplasia of the stomach, Left shoulder injury ( unable to lift left shoulder above head). \r\nMo has wash daily in the bathroom over bathroom sink, perching stool in the bathroom for her to sit and have a wash.  Clean clothes in the bedroom in her wardrobe, incontinence pads is kept in the front bedroom by hallway. \r\nMo self medicates but please monitor she has taken all her medication due and prompt to take meds if she forgot to take meds. Kitchen bin is in the shelf through the kitchen. Mo has dressing on left leg due to cut on shin, please be mindful not to get dressing wet. \r\nMo mobilises with Zimmer frame, please ensure frame is left near her at all times to minimise the risk of her falling. ', 'Wolverhampton', '2024-03-25T11:30', '', '0a4fbfe1c53a3a2f5cc6b32ff5f6fa87d2692e91f540de1dd23a120a586dc21c', 'Domiciliary care', 'My home, my son and my daughter are important to me and visits when they have a days off from work. \r\n', 'I do not have have much dislikes ,i am quite laidback and easy going.  I use enjoy for walks before my mobility deteriorate. I Now enjoy reading and watching the TV. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6827267', '-1.9309046', '', ' 8026934', '6798ff9775592.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:02:31'),
(27, 'Mrs.', 'Wendy', 'Waterfield', '', 'Wendy', '', 'She/Her', '1946-11-30', 'DM - Diabetes mellitus Anxiety (finding) Depression On severe mental illness register Bipolar disorder (disorder) CKD - chronic kidney disease Has a tremor', '1922414158', '', 'Christianity', 'Female', 'Cannock', '32', 'Bluebell Lane, Great Wyrley, West Midlands', 'Wolverhampton', 'West Midlands', 'WS6 6HG', 'United Kingdom', 'Key safe: 2304B', 'Wendy Waterfield (WW) lives with her husband in a bungalow. \r\nDNAR: NOT IN PLACE.\r\nWW will have only female carers.\r\nWW is diagnosed with severe mental illness, diabetes (type2), Bipolar and, depression and anxiety.\r\nWW communicates verbally and will respond when prompted.\r\nWW is independently mobile on a good day and will struggle on certain days, Risk of fall observed.\r\nWW had several falls within a short time in January due to her legs giving way which took her to the hospital. Carer to monitor and support when walking around.\r\nWW gets very anxious when her husband is not within sight, encouragement and reassurance is required.\r\nWW has shaky hands which makes it difficult to hold her cup of drink, she would most times lean forward from her resting chair to drink with a straw from her cup, a carer to support with her drinks.\r\nWW is double continent and will request to use the toilet when she requires to, carer to support to use the toilet. when this is not practicable, her commode can be used.\r\nWW is yet to be seen by the OT concerning her mobility.\r\nWW\'s husband supports with her medications and meals, and carers are to support her with making a drink, offer snacks or preparing meals when her husband is not able to.\r\ncarer to support with strip wash daily and shower when required. WW likes to have a wash and change into a Nightie before going to bed as well.\r\nWW has got pressure sore in her upper thigh, pressure areas are to be monitored and cream applied as required.', 'Wolverhampton', '2024-02-27T12:00', '2025-02-27T12:00', '7ae2e38b8a061c800b79e936605201b371b027284a4a2c5650cd3da9581421a9', 'Domiciliary care', 'Wendy used to like cycling. presently likes to sit by the fire place in home due to declined mobility.', 'Wendy used to like cycling. presently likes to sit by the fire place in home due to declined mobility.', 'Null', '\r\nDM - Diabetes mellitus\r\nAnxiety (finding)\r\nDepression\r\nOn severe mental illness register\r\nBipolar disorder (disorder)\r\nCKD - chronic kidney disease\r\nHas a tremor', 'Null', 'Null', 'Null', 'Null', '52.6518755', '-2.0140535', '', '6060215', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 09:33:37');
