(39, 'Mr.', 'Eino', 'Luppe', '', 'Eino', '', 'He/Him', '1929-10-07', 'None', '1922416968', '', 'Christianity', 'Male', 'Great Wyrley', '244', 'Walsall Rd., Great Wyrley, Walsall WS6 6DL', 'Wolverhampton', 'West Midlands', 'WS6 6DL', 'United Kingdom', 'No key safe in place, Eino will open door on arrival.', 'Property is located next to a nursery called Puddleducks. Drive way available to park', 'Wolverhampton', '2023-10-23T16:39', '2025-10-23T16:40', 'db7881f8f46e00e19a0aaff12ba8281e0a7947c1ae1e6e9d9371f186874f283c', 'Disability care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6615975', '-2.0100436', '', '100470963', '6798f9ceb70c3.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:37:50'),
