(54, 'Ms.', 'Joan', 'Newton', '', 'Margaret', '', 'She/Her', '1934-04-07', 'None', '1543278147', '', 'None', 'Female', 'Cannock', '32', 'Bridges Crescent,, Norton Canes,, Cannock, WS11 9PA', 'Wolverhampton', 'West Midlands', 'WS11 9PA', 'United Kingdom', '0305- key safe on left side of the property.', '\r\nJoan lunch call on a Friday is a cleaning call to clean her house. Areas to clean are \r\n>upstairs toilet\r\n>kitchen surface and cupboard doors. \r\n>Hallway \r\n>living room where Joan sleeps. ', 'Wolverhampton', '2022-01-21T16:20', '2025-01-21T16:20', 'ce1359421d1d692493b5781e33bdb5afdf718eedce074311c2d9e2d442a1e425', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6698308', '-1.9755108', '', '9840166', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
