(105, 'Ms.', 'Christine', 'Carter', '', 'Christine', 'Christa831@outlook.com', 'She/Her', '1932-11-21', 'Poor mobility', '138 491 0242', '', 'Christianity', 'Female', 'Kinver', '29', 'Huntsman Dr, Stourbridge, Staffordshire', 'Wolverhampton', 'West Midlands', 'DY7 6BA', 'United Kingdom', 'Key safe: not currently in use. carers to ring the door bell and wait patiently for CC to open the door.location: bungalow is located next to house number 31 (opposite house number 20). there is a big tree in front of the house, with a road side parking space. walk towards the house over a little field, you will find the short wooden gate with number 29 on it (not very visible from distant) open the gate and walk in through the front garden, entrance door is by the left side of building. press', 'CC is a 91 year old lady who looks very strong, \r\nI used to work as a carer in a hospital many years ago. I have 8 children who live in different parts of the world. I currently live alone as family likes far. she is always in touch with family though the comms which she use for video communication anytime she likes. full mental capacity, communicates verbally and likes to chat, independently slowly mobile within her home by holding onto furniture. CC does not like to be hurried with her personal care due to her frailty and she wants carers to spent her complete time with her at all calls. supports herself with her medication from blister pack and pain killer from original packet, requires prompting to take her medication at all call. support with personal care as required, shower or wash: support to sit safely on shower chair and hold shower spray for her while she washes self, support to was hard to reach areas. support safely out of shower by ensuring shower floor is dried before she stands up, assist to dress up. support to wear her knee support and hand gloves. assist with massage of hands, knees and other areas with her cream scheduled in app.\r\nCC wears denture, support to put denture in sterodent liquid at bed call and wash and hand back to her at morning call. family does her shopping, assist to arrange and put shoppings away when delivered. assist with laundry, linning washed clothes and bringing back in when dry.\r\nCC likes her bed well made daily.\r\nAssist with a like freshen up wash at bed call and change into nightie.\r\nAT bed call, ensure back door is locked, all windows are closed and curtains are closed as she is not able to reach them and open curtains at morning calls.\r\nEnsure life pendant is worn every morning.', 'Wolverhampton', '2024-07-23T 19:00', '', 'ad4d117a4d77db7f76f192f80496d473880c7997473e1de794291ca696d85756', '', 'My family is very important to me and I like to keep in touch with them even when they live far from me.', 'I like to sit out in my garden, watch TV (wild life channels), listen to flute music, news. and go out on my wheel chair with my family. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.456891', '-2.148731', '', '', '6798f6190368e.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:22:01'),
(106, 'Mr.', 'Alfred', 'Malpass', '', 'Alfred', '', 'He/Him', '1935-03-03', 'Cancer of prostate, Weak heart, Poor mobility, Breathlessness', '178 266 0740', '', 'None', 'Male', 'ST', '244', 'Fearns Ave, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 8LS', 'United Kingdom', '4577', '1. Son-Andrew-07415157312\r\n2. Daughter In law-Joanne-07952956508\r\n3.Social Worker-Kay-07967334161\r\n4. He is frail please ensure he uses his walking stick and let him catch some breath at every point.\r\n5.Allow him as much independence as he would like, but keep a close watch because he is prone to falling.', 'Stoke on Trent', '2024-07-29T10:34', '', '9ea6343c99c8bf4a51ea7790eb913633d4f68a9e26ede03a5c5a726d4361a53e', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0463168', '-2.2324507', '', '4744323391', '67ae071e06f1b.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 14:52:14'),
