(108, 'Mrs.', 'Kathleen', 'Kelshaw', '', 'Kathleen', '', 'She/Her', '1939-11-26', 'diagnosed with ANXIETY.', '190 282 0228', '+447756330161', 'None', 'Female', 'Codsall', '36', 'Heath Farm Rd, Codsall, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV8 1HT', 'United Kingdom', 'Key safe: C3541# Location: Key safe is located at right side wall of the building', 'Kathleen is an elderly lady, \r\nDNAR:NO.\r\nKK is diagnosed with ANXIETY.\r\neasily gets anxious when her expectations are not met, when she has not decided what to have for breakfast. carer must engage in conversation, pin calm voice, listen to her and encourage. likes to chat with carers but does not like noise. independently mobile, used to be very independent. carer must continue to promote her independence by encouraging to come to kitchen to prepare meal when her anxiety is not high.KK administers her medication by herself.\r\nKK requires support with personal care, clothes change, meal  preparation and washing and spreading the laundry. carer must remind to wash the bathroom towels weekly. likes porrige, cereal for breakfast, sandwich for lunch or tea, ready meals for tea or lunch.\r\nKK likes to shower daily. like tea (No sugar) a lot of water and sometimes drink coffee.', 'Wolverhampton', '2024-07-31T13:00', '', '9fae5d82ab5caf990547ab9907bf4f614149a3299ea6067fdfc43449ab6d7984', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.623613', '-2.1838209', '', '100513616', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-12-02 09:53:32'),
(109, 'Mr.', 'Ronald', 'Simcock', '', 'Ron', '', 'He/Him', '1940-04-12', '-', '190 276 3115', '', 'None', 'Male', 'Kinver', '5', 'Drive Fields, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV4 4XY', 'United Kingdom', 'LOCK CODE : 0440', 'Ronald Simcock, preferred to be called Ron lives alone in semi detached house, though Ron\'s Children often visit frequently to support his care. The front door serves as the main entrance to the apartment.Key lock is behind the waste bin, on the wall - Lock Code is 0440. Ron needs carer to assist him every morning to empty, dispose and replace night catheter bag; there are rolls of mini sized black waste bag in his room for discarding used night catheter bags . Carer should endeavor to assist Ron with daily body wash and full shower on Wednesdays.\r\nRon wants carer to focus attention on washing/ applying cream on his feet and changing his socks with a clean one. Carer should also assist Ron by applying cream on sore areas(bum and back) Ron has capacity to administer his other medications and prepare his meals. \r\nRon likes to watch television and walk short distances in the building premises. Carers should carefully lift the inner entrance door while opening to exit the apartment.', 'Wolverhampton', '2024-07-30T09:29', '', 'da9dc5bde32d5f4835f0a9dc282b6e1bd524c28d5fb0ac1c328bb3417d9342c0', '', 'Children', 'Ron was an active football player and likes to keep his garden in good shape. \r\nRon likes to sleep in his bedroom and have his body washed in the bathroom upstairs. Ron is not an early riser and prefers watching sport programs on the TV during the day.', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5682588', '-2.1820262', '', '', '6798f737ef7f4.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:26:47'),
