(127, 'Ms.', 'Joyce', 'Williams', '', 'Joy', 'carlajwilliams@hotmail.com', 'She/Her', '1954-01-19', 'struggle with breathing and have an oxygen concentrator', '154 387 9716', '7531927700', 'None', 'Female', 'Cannock', '20', 'Kingsley Ave, Cannock, Staffordshire ', 'Wolverhampton', 'West Midlands', 'WS12 4EA', 'United Kingdom', 'KEY SAFE: 2411', 'I am Joyce Williams, I preferred to be called Joy. I live alone in my Bungalow. Kindly ring the bell and get the key in the key safe: CODE 2411. I use to work in the healthcare sector and later supported my husband as his full time carer before he went to the care home. I have three children and they visit to support me with domestic tasks.\r\nI am independent. However, I struggle with breathing and I have an oxygen concentrator in the living room that support me with breathing. I sit in the living watching TV most of the time. I want carer to support me with meal preparation in the morning - I prefer to have CRUNCHY NUT and COLD MILK for breakfast every morning. I also need carers to warm and keep chicken soup in the flask as lunch. I always keep bottles of water by myside for hydration. The foods are in the kitchen cabinet. Carers should prompt me to administer my medication in the morning before they leave.', 'Wolverhampton', '2024-09-20T12:30', '', '1032', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.7158642', '-1.9979166', '', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-30 11:48:30'),
(128, 'Ms.', 'Jean ', 'Wildman', '', 'Jean', 'markfoodoflove@gmail.com', 'She/Her', '1955-09-20', '-', '742 110 6673', '', 'Christianity', 'Female', 'Cannock', '227', 'Cannock Rd, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV10 8QL', 'United Kingdom', 'No key safe, knock at the door for family to let you in.\r\nHouse is at the opposite side of the road after the Westcroft Nursery.', 'JW lives with Her husband and son in a big house, JW and husband lives downstairs while son uses the top floor. JW requires support of one carer with personal care: strip wash in the downstairs washroom. JW has a brace attached to right leg due to shatted knee cap after a fall in July, family supports with removing of brace when required, carer to be mindful o prventing water from getting to leg brace. JW is slowly independently mobile with zimmer frame and Risk of Fall. Commode to be used to transfer when JW is not able to mobilise long distance. one Carer to support when mobilising to wash room and back to chair with a side supportive escort to supervise and encourage. JW sits on a pressure cushion on her resting chair in the lounge. One carer to support with wash, dress and undress, mobility with frame, breakfast when required as family often does the meals, JW administers her pain killer medications herself, carer to support with creams.', 'Wolverhampton', '2024-09-20T12:30', '', '1033', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5960209', '-2.1161566', '', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-12-09 15:05:45'),
(129, 'Mr.', 'John', 'Arrowsmith', '', 'John', '', 'He/Him', '1942-04-03', 'John is currently not able to stand or walk due to weakness in legs from knee to feet.', '190 284 3570', '7977737913', 'None', 'Male', 'Codsall', '43', 'Ravenhill Dr, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV8 1BL', 'United Kingdom', 'No key safe. Knock at the door for Pat to let you in', 'John is an elderly man who lives alone in his home but neighbour, Pat is often with him to support him all the time. communicates verbally, full mental capacity, wears dentures.\r\nDNAR: NO\r\nJohn is diagnosed with Diabetes and does not have sugar, Insulin injection is administered daily by the nurses. John is currently not able to stand or walk due to weakness in legs from knee to feet.\r\nTransfer is with the molift with belt, John is able to hold onto the molift to transfer to wheeled commode when he needs the toilet. The commode is a means of transfer to bed and back to chair.\r\nJohn will have a wash every morning while sat in bed or on the commode. Support with change of clothes, creams application of legs due to dried skin. Support with making breakfast of choice with a glass of water and cup of coffee with NO SUGAR.\r\nJohn awaits review of the physio. \r\nEncourage John to practice is prescribed exercise when ever he stands on the molift; John to lift left foot up and down, lift right foot up and down, repeat this exercise a few times before sat back on chair at all calls.\r\nJohn is catheterised; Support with catheter care such as emptying bag at all calls. change catheter weekly as scheduled, connect night bag at bed time and ensure catheter is flowing into night bag, detach night bag every morning and lock catheter valve. empty and wash commode at all calls as Pat also supports to use the commode during the day.\r\nJohn has his medications in Dose box which he administers by self. Inform Pat and John before leaving at all calls.\r\nEnsure John has his trolley at his bed side at bed time with all required item on it; water etc.', 'Wolverhampton', '2024-09-23T14:30', '', '1034', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6286671', '-2.1936668', '', '', '6798fe35122ca.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:56:37'),
(130, 'Mr.', 'John', 'Twigg', '', 'John', 'jontdebs@gmail.com', 'He/Him', '1951-05-17', '-', '178 271 4581', '754 817 6668', 'None', 'Male', 'ST', 'Northwood Ln', 'Newcastle, Staffordshire ', 'Stoke on Trent', 'West Midlands', 'ST5 4BN', 'United Kingdom', '-', '-', 'Stoke on Trent', '2024-09-24T09:00', '', '1035', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.9788197', '-2.2163232', '', '9820075', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-20 09:51:49'),
(131, 'Mr.', 'Trevor', 'Jinks', '', 'Trevor', '', 'He/Him', '1942-04-20', '-', '178 256 1188', '', 'None', 'Male', 'ST', '7', 'Ripon Ave, Newcastle ,', 'Stoke on Trent', 'West Midlands', 'ST5 7DZ', 'United Kingdom', 'Knock and wait for his wife to open door', 'NOTES:\r\n1. Knock and wait for his wife to open door.\r\n2. Introduce yourself and show your ID card.\r\n3. Encourage out of bed-he may get full strip wash either in the living room or bedroom. Allow independence where required.\r\n4. Ask for his choice of cloth ensuring it is weather friendly.\r\n5. HIS FEET IS BANDAGED, WATER MUST NOT TOUCH THE BANDAGE.\r\n6. Transfer with his wheeled commode when required.\r\n7. He gets transferred with his wheeled commode.\r\n8. He has pressure reliving cushion, bed  overlay mattress.', 'Stoke on Trent', '2024-09-23T10:30', '', '1036', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0417566', '-2.2496026', '', '100527109', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-18 09:56:41'),
(132, 'Mr.', 'John', 'Tomkinson', '', 'John', '', 'He/Him', '1955-02-18', '-', '784 169 0662', '', 'None', 'Male', 'Burntwood', '26', 'Biddulph Park,, Ironstone Road, Burntwood, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS7 1LG', 'United Kingdom', '-', 'Turn right to Biddulph Park along Ironstone road and follow the road to the end. Take to the right further, the property is the third grey building by the left after a yellow bungalow. The entrance is via the  left side of the bungalow. ', 'Wolverhampton', '2024-09-25T16:00', '', '1037', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.688553', '-1.9460697', '', '9815568', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 11:43:46'),
(133, 'Mrs.', 'Ann', 'Bowers', '', 'Ann', '', 'She/Her', '1934-07-11', '-', '178 276 7281', '', 'None', 'Female', 'ST', '24', 'Thames Dr, Biddulph, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST8 7HL', 'United Kingdom', '-', 'NOTES:\r\n1. AB lives with her son Peter(07375051447)\r\n2. She would tell you how she wants it to go.\r\n3. Full body wash, son would leave out clean clothes.\r\n4. Support with meals and medication where son is unable to do so. (ask if she would like anything or if she has had something to eat and medication)\r\n5. Open and close curtains at right time\r\n6. Remove shoes or wear shoe protector.\r\n7. Report concerns as soon as possible to office and son.\r\n8. In emergency case kindly call: 999/111/on call/son\r\n9. Ensure to do all that is required.\r\n10. AM call is 45mns. kindly exhaust the time.\r\n11. If running late, you know way before time kindly call and inform.', 'Stoke on Trent', '2024-10-02T07:00', '', '1038', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.1172465', '-2.1660684', '', '100504724', '67ae0745bc1c4.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 14:52:53'),
(134, 'Mr.', 'Robert', 'Nixon', '', 'Robert', '', 'He/Him', '1938-03-01', '-', '178 252 2676', '', 'None', 'Male', 'ST', '20', 'Slater St, Biddulph, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST8 6JF', 'United Kingdom', 'Key Safe: 2409\r\n\r\nLock Box (Medication): 409', 'NOTES\r\n1. Its medication only 15mns.\r\n\r\n2. All medications are in original packs carefully read  through they are not much.\r\n\r\n3.Kindly take not the CREON 2500 Gastro Resistant capsules, is 3 tablets, at Tea time with or after main meal (ensure he has had something to eat please)\r\n\r\n4.Keith is his brother in law (call for anything +44781 5538021)', 'Stoke on Trent', '2024-10-03T12:30', '', '1039', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0400718', '-2.2042029', '', '100463085', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-24 08:45:34'),
(135, 'Mr.', 'George', 'Beasley', '', 'George', '', 'He/Him', '1931-10-05', '-', '178 251 1426', '783 460 7716', 'None', 'Male', 'ST', '27', 'Newpool Terrace, Brown Lees', 'Stoke on Trent', 'West Midlands', 'ST8 6PE', 'United Kingdom', '1939', 'NOTES:\r\n1. Use key safe\r\n2. Introduce yourself on arrival.\r\n3. Prompt to go to the bathroom for wash or shower (if shower ensure shower seat is in place)\r\n4. Christine (daughter) 07834607716\r\n5. Call emergency; 999/111/on call line and family.\r\n6. Report medication running out 3-5 days before the last one.\r\n7. Ensure he has taken something before administering his medications****\r\n8. AM call is 45mns kindly note.\r\n9. Ensure you have tidied up all used areas.\r\n10. Open/close curtains\r\n11.Communicate with him, he can make choices\r\n\r\n*** cameras are installed to monitor him and care calls by daughter. Family are fully involved in his care.', 'Stoke on Trent', '2024-10-08T11:30', '', '1040', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.103604', '-2.1855398', '', '100473014', '67ae0940c3dc1.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:01:20'),
(136, 'Mrs.', 'Lynda', 'Keeling', '', 'Lynda', '', 'She/Her', '1947-05-29', 'She is diabetic', '178 250 3926', '', 'None', 'Female', 'ST', '1', 'New Ln, Brown Edge, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST6 8TQ', 'United Kingdom', '1948 (is by the front door)', ' -She is diabetic\r\n-She must not have toast-it is a no no\r\n-Matthew (son) 07815808707 ,07860555598.(he stays closest to mum than Heather)\r\n-Heather (daughter)07887731010\r\nplease make sure all blinds are opened in the morning.\r\n-Emergency call: 999/111, On Call  line\r\n-', 'Stoke on Trent', '2024-10-12T12:00', '', '1041', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0845285', '-2.1422231', '', '100511634', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-05 10:36:33'),
(137, 'Mr.', 'Gary', 'Jeffcott', '', 'Gary', '', 'He/Him', '1935-11-13', 'Poor mobility', '178 251 1560', '', 'None', 'Male', 'ST', '-', 'Newtown, Stoke-on-Trent', 'Stoke on Trent', 'West Midlands', 'ST8 7SW', 'United Kingdom', '1935', '***ADDRESS: \r\n                         Newton Road\r\n                         Biddulph\r\n                         ST8 7SW \r\n1. Kindly, ask him if he wants the Laxido and Lactulose before administering.\r\n2. Drinking water is to be taken from the bathroom tap(cold one). DO NOT GIVE DRINKING WATER TAKEN FROM THE KITCHEN PLEASE, FAMILY SAYS IT IS NOT CLEAN WATER.\r\n3.He mobilises using his walking sticks (he has 2)He mobilises slowly so be patient with him.\r\n4. He likes to take his shower in the afternoon and he does this himself-but you do assist him where he requires it.\r\n5.He puts on his previous clothes and changes them when he has his showers.\r\n6.GJ MEALS:\r\nAM-2 Weetabix, 1mug of tea no sugar with milk.\r\n        Roomas of toast thick with butter.\r\nLUNCH- 2 thick sandwich and 11 mug of tea.\r\nTEA- Hot meal-cottage pie or vegi and meat.\r\nBED-1 weetabix, milk no sugar and 1 mug of tea,', 'Stoke on Trent', '2024-10-19T12:00', '', '1042', 'Domiciliary care', 'Null', 'Null', 'Null', 'Hearing disability', 'Null', 'Null', 'Null', 'Null', '53.0883655', '-2.2035977', '', '1216984', '67ae092e26e69.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:01:02'),
(138, 'Mrs.', 'Joyce', 'Colley', '', 'Joyce', '', 'She/Her', '1942-10-16', '-', '790 637 5306', '793 871 9525', 'None', 'Female', 'ST', '37', 'Harper Ave, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 9DT', 'United Kingdom', '1942', '##JC has short term memory (awaiting memory clinic apt.)\r\n-Mini stroke (Sept. 2024)\r\n-Rectal Hemorrhage (Feb.2024)\r\nBi Lateral leg swelling (Nov. 2023)\r\n-Dyspnea (Oct. 2023)\r\n* EMERGENCY: 999/111/\r\n* Sister: Bertram-01782619111\r\n*Son:Steven-07906375306\r\n*Son:Adrian-07585009843\r\n*Medication time conscious\r\n*', 'Stoke on Trent', '2024-10-25T13:00', '', '1043', 'Domiciliary care', 'Null', 'Null', 'Null', 'Short term memory loss, Rectal hematoma, Dyspnea', 'Null', 'Null', 'Null', 'Null', '53.0263818', '-2.2311888', '', '100526575', '67ae0b1d51848.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:09:17'),
(139, 'Mr.', 'Ian', 'Betts', '', 'Ian', '', 'He/Him', '1943-11-19', '-', '785 196 9836', '154 327 8492', 'None', 'Male', 'Great Wyrley', '71', 'Norton E Rd, Cannock, Staffordshire, ,', 'Wolverhampton', 'West Midlands', 'WS11 9RR', 'United Kingdom', 'Key safe: 1947 ( the big key safe)', 'Ian lives with wife in a house, communicates verbally and independently mobile with frame or stick. Carer to support during transfer to ensure safety.  Promote independence by providing required items to complete personal care, support to wash hard to reach areas of body. \r\nSupport is required to get out of bed in the morning, support with a wash upstairs, clothes change and support to come downstairs using the stairs lift. support with preparing breakfast (3 wheatabix), make and leave sandwich for his lunch, support with medication administration. record and report any concern to the office. supports to bed at bed call, change of clothes and ensure comfortable. ensure door is locked and key returned to safe before leaving.', 'Wolverhampton', '2024-10-22T15:00', '', '1044', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.673161', '-1.9641061', '', '100521028', '6798fd1cef96f.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:51:56'),
(140, 'Ms.', 'Marjorie', 'Whitehouse', '', 'Marjorie', '', 'She/Her', '1936-09-17', '-', '154 332 6624', '', 'None', 'Female', 'Cannock', '59', 'Morley Rd, Burntwood, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WS7 2DE', 'United Kingdom', 'Keysafe 1736.Location: right outside corner of the porch. porch door is not locked, key is for entrance door.House is located on opposite side of the road after the Co-OP', 'Marjorie lives with Son, Stephen and a gentle black cat in a house with a drive way long the road. slowly independently mobile with frame. urine and bowel continent but a few times may have bowel incontinent at night. MW has he left leg shorter than the right so wears a special boot to help even this up, boot to be worn every morning after washing legs, applying cream to leg (from knee to feet), put on compression socks, leg brace and black boot.\r\nDNAR: NO\r\nMW communicate verbally, has full mental capacity, MW assess bedroom upstairs with the stairs lift. carer to promote independence by passing her warm water bowl with flannel and soap to support self with wash and support to wash hard to reach areas like back. Likes to have her body wash and leg wash while sat on the commode in bedroom. MW wears dentures; denture to be put in steradent liquid at bed call and wash to put on at morning call.\r\nAM: support out of bed to sit on commode for strip wash, leg wash, put on socks, brace and boot, clothes change, denture replaced and support down stairs for breakfast, wash commode, ensure safe in sitting position and lock door, keep keys in safe.\r\nPM: support to go upstairs to bedroom with the stairs lift, change of clothes, keep denture in steradent liquid, make comfortable in bed. ensure door is secured.', 'Wolverhampton', '2024-10-21T13:00', '', '1045', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6826608', '-1.9197391', '', '8054157', '6798ff579a6d2.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fc