(141, 'Mr.', 'Kenneth', 'Keeling', '', 'Kenneth', '', 'He/Him', '1936-02-05', 'Dementia', '786 630 9459', '', 'Christianity', 'Male', 'Codsall', '36', 'Fairfield Dr, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV8 2AE', 'United Kingdom', 'no key safe, wife will open door for carers. ', 'I worked as a bank manager at NatWest bank. \r\nKenneth has Dementia and he lives with his wife and his daughter and sons visits often. Assist to put compression sock/stocking on after wash. Kenneth prefers to have a wash in his room using a wash bowl. Kenneth enjoy have a chat and is quite laid back. ', 'Wolverhampton', '2024-10-22T16:00', '', '1046', 'Domiciliary care', 'My wife, daughter and my two sons are important to me.   My home is important to me. My parents use to own a pub where I use to work as a youth until I join the bank working a a bank manager. ', 'I use to enjoy sudoku, gardening, going on holiday travelling to different countries, and watching the tv. \r\n\r\nI do not like being told what to do sometimes. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.6288881', '-2.2069164', '', '', '6798feb64b6ca.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:58:46'),
