(153, 'Mrs.', 'Joyce', 'Smallwood', '', 'Joyce', '', 'She/Her', '1942-07-07', '-', '795 694 3905', '', 'None', 'Female', 'ST', '97', 'Buckmaster Ave, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 3AL', 'United Kingdom', '-', '1. Key contact details:\r\n**Amanda-Daughter-07777127110\r\n*Charlotte-Grand Daughter-07395741960\r\n**Gareth-Mother In Law- 07435224220\r\nIMPORTANT:\r\n1. She is hard of hearing so come close, speak clearly and slowly\r\n2. Knock before you enter and kindly introduce yourself\r\n3.Prompt her to take her medication\r\n4.Check and ensure she eats her meals\r\n5.Encourage independence\r\n6. Ensure her kindle book and mobile phones are charged\r\n7. BE PATIENT WITH HER AND SEEK HER CONSENT TO DO ANY TASK-PLEASE\r\n8. If she says she has had a wash, check if she is properly dressed. If she is not be diplomatic in talking her into redressing as she may object.\r\n9. If she refuse any assistance kindly ask if you could make the bed, check the bathroom to ensure its tidy, clean the kitchen and dirty plates or load the dirty clothes into the washing machine\r\nREPORT ANY CONCERNS IMMEDIATELY', 'Stoke on Trent', '2024-12-05T08:00', '', '1058', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.9986655', '-2.2177748', '', '100529135', '67ae0b0380e89.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:08:51'),
