(158, 'Ms.', 'Lone (Lona)', 'Rushton', '', 'Lona', '', 'She/Her', '1940-09-16', '-', '190 270 1586', '', 'None', 'Female', 'Pattingham', '13', 'Letchmere Cl, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV6 7AJ', 'United Kingdom', 'Keysafe number 3459B', '-', 'Wolverhampton', '2024-12-24T10:45', '', '1063', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5882194', '-2.2607824', '', '', '6798ff03a42bf.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 16:00:03'),
(159, 'Mr.', 'Michael', 'Collier', '', 'Michael', 'mavisandmichael@aol.com', 'He/Him', '1936-01-03', '-', '153 826 6470', '781 419 1740', 'None', 'Male', 'ST', '46', 'Brookfields Rd, Ipstones, ', 'Stoke on Trent', 'West Midlands', 'ST10 2LY', 'United Kingdom', '-', '1. The morning call is very time-specific, and the family will like us to oblige to the time given, 08:30, due to the risk of falling should he attempt to get out of bed.\r\n\r\nAll should note to use the door furthest from the main entrance to gain access. For now, youâ€™ll have to knock to gain entry. The client lives with his wife, and sheâ€™ll answer the door as well as answer any and all questions pertaining to his care should it be necessary.\r\n\r\nIn the morning, you are to transfer him from his bed to the bathroom, and depending on how heâ€™s feeling, he might use his Zimmer frame where you are to provide support from behind as he makes his way to the bathroom or his commode as a means of transport.\r\n\r\nYou will assist him to undress while seated on the toilet, give a strip wash, and assist with oral hygiene when and where necessary. Also, monitor his skin integrity and apply cream or spray where necessary.\r\nHis incontinence pad, clothes, and all things needed will already be in the bathroom. If absent, politely ask his wife.\r\n\r\nAfter the personal care, transport him into the living area, then to his chair. Food and medications will be taken care of by his wife.\r\n\r\nPlease take time to make his bed, change sheets and duvet/duvet covers when wet or dirty.\r\n\r\nIn case youâ€™re done before the allotted time, kindly ask the wife if thereâ€™s anything sheâ€™ll need assistance with and help out where appropriate and legal. This is for all calls.\r\n\r\nFor his lunch call, the aim is to get him to go to the loo, change his pads, and to get him moving. For this particular call, please be there on time, 12:30, because they aim to have lunch by 13:00.\r\n\r\nDuring the tea call, he changes into his nightwear . Tea call tasks are the same as the lunch call. Bed call; he puts on an extra pad. Please do ask his wife to provide you with the additional one before proceeding to change the soiled one, and then assist him to bed, apart from these, it follows the same pattern as the other calls.\r\n\r\nREMEMBER TO INTRODUCE YOURSELF TO HIM AT ALL TIMES. PLEASE SPEAK CLEARLY AND SLOWLY.\r\n\r\nCommunication is key; canâ€™t stress this enough. Maintain good communication throughout all calls.\r\n\r\n2. In case of an emergency, his wife is the first point of contact, after which you call 999', 'Stoke on Trent', '2024-12-30T08:30', '', '1064', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0445922', '-1.9691459', '', '9740895', '67ae0bf10ef5c.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:12:49'),
