(164, 'Ms.', 'Elien', 'Capper', '', 'Elien', '', 'She/Her', '1929-08-02', '-', '178 263 4114', '', 'None', 'Female', 'ST', '24', 'Tregew Pl, Silverdale, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 6PG', 'United Kingdom', '1956', '1. Stevenson (Son)-07801020060\r\n2. GP-01782381680\r\n3.KSafe:1956\r\n\r\n*****Dipyridamole 200mg modifies relwase capsules (Color: Orange caps) to be taken AFTER FOOD PLEASE\r\n\r\n*****Calceos 500mg/400unit chewable tablets:(Color: white square) chew or suck.', 'Stoke on Trent', '2025-01-02T08:45', '', '1069', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.014861', '-2.272667', '', '2441240', '67ae08b82007a.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-27 08:18:03'),
(165, 'Mr.', 'James', 'Laverty', '', 'James', '', 'He/Him', '1964-12-05', '-', '781 313 4199', '', 'None', 'Male', 'ST', '17', 'Chester Cl, Talke', 'Stoke on Trent', 'West Midlands', 'ST7 1SP', 'United Kingdom', '-', '1. Melisa (daughter) 07512320187\r\n2. He lives in a dormer bungalow\r\n3. He is semi ambulant with the aid of a walking stick/tripod walker\r\n4. He has a wheelchair in the garage\r\n5. He has a bath aid which raises and lowers him into the bath\r\n6. Breakfast: orange juice, bowl of cereal and a cup of tea.\r\n***** Remember to prepare something for lunch and wrap and put in the fridge for him to access kindly let him know\r\n7. He should be offered shave\r\n**** Medication\r\n**** Call duration is 1hour please ensure you observe to do as expected before leaving.', 'Stoke on Trent', '2025-01-04T09:30', '', '1070', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0741048', '-2.2536676', '', '100509244', '67ae0a47c15f5.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:05:43'),
(166, 'Ms.', 'Paula', 'Thomas', '', 'Paula', '', 'She/Her', '1959-09-18', '-', '741 544 7051', '', 'None', 'Female', 'Cannock', '5', 'Willow Walk,', 'Cannock', 'West Midlands', 'WS12 4QQ', 'United Kingdom', 'To locate the property, turn onto cherry tree road, willow walk is on your left by the open land area as you turn on the road. Key safe code- 1809', 'I live with my daughter and my pet dogs. I struggle to speak at times since I had a stroke in 2014 and I also have Dementia. I do not have a DNAR in place.\r\nI require support with personal care, food and drinks preparation, prompt to take my medication. Paula attend day care centre every Thursday, require morning call at 8:30.', 'Wolverhampton', '2025-01-08T09:15', '', '1071', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.9852264', '-2.1375497', '', '9602486', '67ae0d9a7d61c.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-03-04 11:49:52'),
(167, 'Ms.', 'Glenys', 'Woolley', '', 'Glenys', '', 'He/Him', '1932-11-22', '-', '777 181 2258', '', 'None', 'Female', 'ST', '41', 'Abbots Way, Newcastle, Staffordshire', 'Stoke on Trent', 'West Midlands', 'ST5 2EX', 'United Kingdom', 'Key safe code- 1932B, key safe is located to the right by the front door.', '1. Julian (daughter)-07899750081\r\n2. Phil (Son)-01782616448\r\n3. EMERGENCY: 999/111/On Call Line.\r\n\r\n*****TASKS:\r\n1. Personal Care: She is not an early rise and would be more active if you come by 10am.\r\nb. If she refuses to shower, kindly offer her if she could do it herself while you stand giving privacy but watchful.\r\nc. Dress/Undress: Ensure she is appropriately dressed for the weather.\r\nd. Meals/Drinks: Kindly prepare meal and drink of choice and offer. She would eat her food if left with her but may require prompting to do so (leave out snacks sandwich or chocolate (moderately)). She is diabetic.\r\n2. Toileting: She uses pad which needs to be changed at each visits.\r\n3.She requires support to mobilise between spaces and requires a suitable footwear and zimmer frame to do so safely.\r\n\r\n*** She would prefer to be in bed after morning routine with the TV on.', 'Stoke on Trent', '2025-01-04T09:30', '', '1072', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0023025', '-2.2279637', '', '9717006', '67ae099e3bf3e.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:02:54'),
(168, 'Ms.', 'Bernice', 'Willetts', '', 'Bernice', 'jcalvert25@talktalk.net', 'She/Her', '1937-09-18', '-', '777 261 8668', '', 'Christianity', 'Female', 'Kinver', '12', 'Wombrook Ct, Wombourne , Wolverhampton, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WV5 9AA', 'United Kingdom', 'Wombourne Court is opposite Churchwell Court, black rail in front of the building. Please do not park in the car park, park on the road side. To enter via the intercom- morning, press trade then press 555 the call. To enter in the afternoon, press trade then press 111, then call. After entering the building, turn right along the corridor, then right, number 12 is on the left side. key safe code- 0617', 'I retired from my profession as a nurse when I was 60 years old. I am aware what is good care and good personal hygiene practice. \r\nI live alone in a living complex building. I have full capacity to make decisions.\r\nI require support with personal care, food preparation. I use a molift to transfer onto commode to use the toilet. Kindly wheel commode into bathroom and push commode over the toilet.', 'Wolverhampton', '2025-01-08T09:00', '', '1073', 'Domiciliary care', 'My home and my children are important to me. I have a daughter and a son. \r\n', 'I prefer to wake up late in the morning around 8:30- 9:00. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '52.5334027', '-2.1872088', '', '', '6798fbcfa321a.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-01-28 15:46:23'),
