(172, 'Mrs.', 'Cheryle', 'Sandbrook', '', 'Cheryle', '', 'She/Her', '1948-02-22', '-', '178 230 4925', '789 170 8162', 'None', 'Female', 'ST', '37', 'Stonehouse Rd, Werrington', 'Stoke on Trent', 'West Midlands', 'ST9 0JX', 'United Kingdom', '1980', '1. William (son) 07739724127\r\n\r\n******\r\n1. Introduce yourself on arrival\r\n2. Gain consent for all tasks\r\n3. Support to transfer/mobilise to bathroom\r\n4. Prompt Independence at all times\r\n5. Monitor skin integrity\r\n6. When preparing meals please offer choice\r\n7. Administer supplements and medications\r\n8. Ensure mobile phone is within easy reach\r\n9. Ensure any items are within easy reach and on the over lay table.\r\nEnsure keys is returned before leaving', 'Bath', '2025-01-10T08:20', '', '1077', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0250989', '-2.0923186', '', '9635958', '67ae0802b7729.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 14:56:02'),
