(174, 'Mr.', 'Neil', 'Gilson', '', 'Neil', '', 'He/Him', '1943-06-07', '-', '790 215 6860', '', 'None', 'Male', 'ST', '30', 'Church Rd, Brown Edge, Stoke-on-Trent ST6 8RA', 'Stoke on Trent', 'West Midlands', 'ST6 8RA', 'United Kingdom', '-', '1. Rachel (daughter) 07711011233\r\n2. Knock and enter, please introduce yourself and state your mission.\r\n3. Support with Personal care, medication and meals.\r\n4.He is unable to bend to wash his legs due to pain\r\n5. Please pau attention to him as he may sometimes get breathless\r\n6. due to swollen legs and ankles he struggles to get dressed.', 'Stoke on Trent', '2025-01-20T11:00', '', '1079', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0808887', '-2.142078', '', '100536832', '67ae0c0949549.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:13:13'),
(175, 'Mr.', 'Peter', 'Linnell', '', 'Peter', '', 'He/Him', '1943-01-31', '-', '178 256 3202', '781 278 4382', 'None', 'Male', 'ST5', '43', 'Oakdene Ave, Newcastle-under-Lyme', 'Stoke on Trent', 'West Midlands', 'ST5 8HQ', 'United Kingdom', '020568', '1. Karen (daughter) 07812784382\r\n2. Rob -07971674916\r\n3. He is diabetic and on diabetic deit and regular fluids\r\n4. Please monitor to see he consumes a significant portion of his meal.\r\n5. He should have strip wash every morning\r\n6. Monitor skin integrity on each call.\r\n7. He has toilet frames in-situ for additional support in both bathroom upstairs and toilet downstairs.\r\n8. He uses incontinence pads\r\n9. Tidy home and ensure home is safe and secure before leaving.', 'Stoke on Trent', '2025-01-20T09:30', '24/02/25 14:00', '1080', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '53.0365986', '-2.2337432', '', '100517991', '67ae0dc2d1da7.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-03-10 11:14:31'),
(176, 'Miss.', 'Margaret', 'Stanier', '', 'Margaret', '', 'She/Her', '1935-12-13', '-', '190 289 8344', '779 312 2674', 'None', 'Female', 'Kinver', 'Flat 19', 'Churchwell Court, Walk Lane.', 'Wolverhampton', 'West Midlands', 'WV5 9HZ', 'United Kingdom', 'Use keysafe 1950', '-', 'Wolverhampton', '2025-01-30T10:30', '', '1081', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '', '100446114', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-03 15:32:28'),
(177, 'Mr.', 'Shaun', 'Wilson', '', 'Shaun', '', 'He/Him', '1964-03-21', '-', '794-954-8266', '', 'None', 'Male', 'ST', '51', 'Mill rise Village, Lymebrook Way, Newcastle-under-Lyme, Staffordshire.', 'Stoke on Trent', 'Staffordshire', 'ST5 9GA', 'United Kingdom', '-', '1. NOK/Emergency contact (Son): 07753480519-David\r\n2. DNAR in place.\r\n3. To go into the main entrance, CLEAR, TRADE 6352 CALL. Enter the lift press 2 second floor.\r\n4.CLEAR,TRADE 6352 CALL to go into his floor look for his flat number 51. then use key code 1011 to his own flat.\r\n5 He uses an incontinence pad , this needs changing in every visit.\r\n6.please check for food in Airfryer every visit to know if he left/forgot it.\r\n7. Tuesdays, Thursdays, and Saturdays are his dialysis days. Kindly INSIST ON SHOWER.\r\n8. Check and clean the commode, which can be found in his room.\r\n9. He uses Epipen for bed call, The Epipen has a calibration; set it to 6 for the orange one and 8 for the gray one, insert the needles on top of it, and give it to him so he can use it himself. After use, take off the needles and discard. He can\'t see very well due to his being diabetic.\r\n\r\nFor any more information/clarification please ring the office.', 'Stoke on Trent', '2025-01-29T04:51', '', '1082', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '', '100453393', '67ae0df4aebe2.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:21:24'),
(178, 'Mr.', 'Charles', 'Knapper', '', 'Charles', '', 'He/Him', '1938-06-19', '-', '776-553-9470', '', 'None', 'Male', 'ST', '2', 'Rookery Rd, Kidsgrove, Stoke-on-Trent.', 'Stoke on Trent', 'West Midlands', 'ST7 4EA', 'United Kingdom', 'Key safe - 2971 Situated at the back of property.', 'READ ME!\r\nCharlie is currently in need of daily support to manage his nutrition and fluid intake, ensuring these needs are met to prevent dehydration and further kidney decline. He can tolerate a normal diet and fluids without any swallowing concerns. However, he often forgets to drink, which poses a risk of malnutrition, dehydration, and weight loss. CharlieÃ¢â‚¬â„¢s preferred meals include porridge, cereal, or toast for breakfast, a sandwich for lunch or tea, and a ready meal for either. He enjoys a cake or biscuits with a warm drink for supper. Additionally, he needs a warm drink or juice left between visits and prompts from care staff to drink during their presence.\r\n\r\nIn terms of personal hygiene, Charlie requires assistance with tasks such as washing and drying. He has been assessed as needing the support of one carer. While living downstairs, Charlie prefers a full body wash in the kitchen, with his wash bowl stored in the bottom kitchen cupboard and towels in his bedroom drawer. He strives for independence and can wash and dry his hands and face, sometimes participating in more tasks if he feels capable. Charlie enjoys showering a couple of times a week and requires one carerÃ¢â‚¬â„¢s assistance for this. Staff are responsible for monitoring his skin integrity and reporting any concerns to the district nurses, while also ensuring respect, privacy, and dignity during hygiene tasks.\r\n\r\nCharlie also needs support with shaving, using an electric razor. Although he is usually clean-shaven, he developed a beard after a hospital stay. His family has organized a beard trimmer and charged his electric shaver to assist staff in maintaining his grooming habits. Lastly, Charlie requires the administration of medication as prescribed by his healthcare provider.\r\n\r\nCharlieÃ¢â‚¬â„¢s current situation requires careful support to prevent unintentional self-neglect and potential deterioration of his emotional health. Staff are instructed to maintain privacy, respect, and dignity during all support tasks.\r\n\r\nToilet Needs Management:\r\nCharlie is generally independent with his toileting but has been wearing a pad as a precaution since his five-week hospital stay. His family purchases these pads independently. Charlie has a commode by his bed and a urine bottle for nighttime use. Downstairs, there is a toilet in the understairs cupboard with a frame and raised seat if needed, and an upstairs bathroom. Staff are responsible for emptying and cleaning the commode, assisting Charlie with pad changes, and ensuring safe disposal. Privacy, respect, and dignity are paramount during these tasks.\r\n\r\nClothing Assistance:\r\nCharlie may need help changing his clothes and requires the assistance of one carer. He is able to choose his own clothing, and staff must ensure privacy, dignity, and respect throughout the process.\r\n\r\nHome Safety Utilization:\r\nThe Home First Clinical and Assessment Team has conducted a functional mobility and transfers assessment, determining that Charlie can transfer independently and use his wheeled Zimmer frame for mobility. He is also capable of managing stairs with both handrails. Currently, family support Charlie with shopping and laundry. Before his hospital admission, Charlie hired a private cleaner, and the family plans to contact her again to see if she can resume her services. Charlie has a keysafe located at the back of his property, identified as 2971. Additionally, family has installed two security cameras within the property: one in the living room near the ceiling and another at the bottom of the stairs, to enhance CharlieÃ¢â‚¬â„¢s safety and peace of mind.\r\n\r\n\r\nCharlie currently utilizes private services from Crossroads on Tuesdays, Thursdays, and Fridays, where he makes a few calls to receive companionship in his home. This arrangement also helps him access the local community before his hospital admission. Both Charlie and his family have come to the conclusion that he would gain from participating in day opportunities once a week. This would allow him to socialize in a secure setting, enhancing his overall well-being and engagement with the community.\r\n\r\nCharlie is participating in a program that involves uplifting and monitoring his mood. If his mood requires adjustment, the program may cancel one of the sessions Charlie has with Crossroads Support to make his day easier. Charlie is open to trying this approach. Additionally, transport will be necessary for Charlie to travel to and from the services he accesses. To engage in day opportunities, Charlie will need support from another person and transport.\r\n\r\n1. Jonathon (Son)- 07765539470 / 07730654013\r\n2. Client communicates well and as such you are to communicate with/to him at all times.\r\n3.LEAVE OUT WARM DRINK/JUICE TO BE LEFT OUT FOR IN BETWEEN EACH VISIT.\r\n3. Key safe 2971 is situated around the back of the property.\r\n4. He goes to Day Care on Thursday; MORECARE comes to pick him up.\r\n5. He has a Zimmer frame and commode. He uses the frame for mobility at times to ensure he is comfortable while using it.\r\n6. Ensure he takes fluid adequately to reduce dehydration and further kidney decline.', 'Stoke on Trent', '2025-01-20T13:00', '', '1083', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '', '100477713', '67ae07f580f90.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 14:55:49'),
(179, 'Mrs.', 'June', 'Goodwin', '', 'June', '', 'She/Her', '1934-01-05', '-', '178-263-7457', '', 'None', 'Female', 'ST', '17', 'Cross May St, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 2TP', 'United Kingdom', '', '1. Colin (son) 01782637457\r\n2. Gill (Friend) 07786195615\r\n3.Apply barrier spray under her breast and to her buttocks.\r\n4. SHE IS HARD OF HEARING, BUT CAN READ LIPS. PLEASE SPEAK CLEARLY AND SLOWLY SO SHE CAN UNDERSTAND WHAT YOU SAY.\r\n5. Introduce yourself on arrival and ensure you spend the allocated time for each.\r\n6. Ensure she is secure and safe before leaving. Also that she is properly clothed.', 'Stoke on Trent', '2025-02-10 10:30', '', '1084', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '', '', '67ae0b3748dbf.png', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-13 15:09:43'),
