(185, 'Mrs.', 'June', 'Whitehouse', '', 'June', '', 'She/Her', '1932-06-28', '-', '178-261-1442', '7794945428', 'None', 'Female', 'ST', '19', 'Monmouth Pl, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 3DF', 'United Kingdom', '1932', '*** KEYSAFE-1932\r\n***07794945428/ 01782611442(June)\r\n***Susan Smith (daughter) 01782680679/07794945428\r\n***Oral care please is twice daily.\r\n*** She uses her walking frame to mobilize and transfers\r\n**** Ensure her lifeline is on her at each call\r\n*** Report/record any behavioral/health changes\r\n**** Ask her for choice of clothing both AM/BED\r\n***Introduce yourself and state mission\r\n***Please put all dirty clothes in the washing machine and run it, spread washed clothes upstairs in the hanger close to the radiator.\r\n***Return keys to key safe\r\n*** Apply moisturizer on her legs and hands\r\n*** 2 sugar on her cup of tea for AM,LUNCH AND TEA.\r\n*** Whole milk with one sugar and a level spoonful of coffee for bedtime call.\r\n*** Breakfast: toast with marmalade with 2 cups of tea.\r\n*** lunch : sandwich, grapes, tomatoes, some little tiny pickles. she can also have banana.\r\n***Tea time : microwave frozen meal for her all in the fridge/freezer, ask her if she wants trifle and some biscuits to go with.\r\n*** Encourage her to get dressed. she likes being in her nighty but daughter wants her to get dressed.', 'Stoke on Trent', '2025-02-27T09:00', '', '1090', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '', '100541842', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2025-02-26 09:48:50'),
